<!DOCTYPE html>
<html lang="en">


<head>
    <meta charset="UTF-8" />
    <meta name="theme-color" content="#000" />
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>


    <link rel='icon'
    href="https://thefinancialexpress.com.bd/uploads/1538459596.jpg" />
    <title>Hangman Game</title>

<style>
        body {
            margin: 0px;
            text-align: center;
            font-family: Arial;
        }

        #background {
            position: fixed;
            top: 0;
            left: 0;
            z-index: -10;
            height: 100vh;
            width: 100%;
        }

        #container {
            align-items: center;
            display: flex;
            flex-direction: column;
            height: 85vh;
            justify-content: center;
        }


        #background-image {
            height: 100%;
            position: relative;
            left: 50%;
            transform: translate(-50%, 0);
        }

        #play-button{
            display: flex;
        }

        /**
        * Default styles for xterm.js
        */

        .xterm {
            font-feature-settings: "liga"0;
            position: relative;
            user-select: none;
            -ms-user-select: none;
            -webkit-user-select: none;
        }

        .xterm.focus,
        .xterm:focus {
            outline: none;
        }

        .xterm .xterm-helpers {
            position: absolute;
            top: 0;
            /**
        * The z-index of the helpers must be higher than the canvases in order for
        * IMEs to appear on top.
        */
            z-index: 5;
        }

        .xterm .xterm-helper-textarea {
            padding: 0;
            border: 0;
            margin: 0;
            /* Move textarea out of the screen to the far left, so that the cursor is not visible */
            position: absolute;
            opacity: 0;
            left: -9999em;
            top: 0;
            width: 0;
            height: 0;
            z-index: -5;
            /** Prevent wrapping so the IME appears against the textarea at the correct position */
            white-space: nowrap;
            overflow: hidden;
            resize: none;
        }

        .xterm .composition-view {
            /* TODO: Composition position got messed up somewhere */
            background: #000;
            color: #FFF;
            display: none;
            position: absolute;
            white-space: nowrap;
            z-index: 1;
        }

        .xterm .composition-view.active {
            display: block;
        }

        .xterm .xterm-viewport {
            /* On OS X this is required in order for the scroll bar to appear fully opaque */
            background-color: #000;
            overflow-y: hidden;
            cursor: default;
            position: absolute;
            right: 0;
            left: 50%;
            top: 0;
            bottom: 0;
            background-color: rgb(0, 0, 0);
            width: 730px;
            transform: translate(-50%, 0);
            box-shadow:  1px 1px 1px 5px #fff;
        }

        .xterm .xterm-screen {
            position: relative;
            left: 50%;
            transform: translate(-50%, 0);
        }

        .xterm .xterm-screen canvas {
            position: absolute;
            left: 0;
            top: 0;
        }

        .xterm .xterm-scroll-area {
            visibility: hidden;
        }

        .xterm-char-measure-element {
            display: inline-block;
            visibility: hidden;
            position: absolute;
            top: 0;
            left: -9999em;
            line-height: normal;
        }

        .xterm {
            cursor: text;
        }

        .xterm.enable-mouse-events {
            /* When mouse events are enabled (eg. tmux), revert to the standard pointer cursor */
            cursor: default;
        }

        .xterm.xterm-cursor-pointer {
            cursor: pointer;
        }

        .xterm.column-select.focus {
            /* Column selection mode */
            cursor: crosshair;
        }

        .xterm .xterm-accessibility,
        .xterm .xterm-message {
            position: absolute;
            left: 0;
            top: 0;
            bottom: 0;
            right: 0;
            z-index: 10;
            color: transparent;
        }

        .xterm .live-region {
            position: absolute;
            left: -9999px;
            width: 1px;
            height: 1px;
            overflow: hidden;
        }

        .xterm-dim {
            opacity: 0.5;
        }

        .xterm-underline {
            text-decoration: underline;
        }

        button {
            width: 250px;
            height: 40px;
            background-color: #3A5960;
            border-width: 0;
            color: white;
            text-transform: uppercase;
            margin: 30px;
            border-radius: 8px;
            font-weight: 600;
            letter-spacing: 1px;
            cursor: pointer;
            box-shadow: 5px 10px 8px #051617;
            border: 1px solid rgb(141, 247, 247);
            line-height: 35px;
            font-size: 25px;

        }
        button:hover{
            background-color: #46BCEA;
            color: #4a3d3d;
        }
        #play-button{
            height: 34px;
            width: 30px;
            float: left;
        }
</style>
</head>
